import cartoon from "./images/cartoon.png";
import "./App.css";

function Nav() {
  return (
    <div className="Nav">
      <ul class="nav navbar-nav">
        <li class="active">
          <a href="./images/connkat-resume.pdf" download>
            Download Resume
          </a>
        </li>
        <li class="active">
          <a href="mailto:hi.connkat@gmail.com">Get in Touch</a>
        </li>
      </ul>
    </div>
  );
}

export default Nav;
